import { useState } from "react";




const TestimonialThumbnail = ({ imgURL, handleImageChange, label }) => {

    const [activeImage, setActiveImage] = useState(imgURL);

    function handleImageChange() {
        setActiveImage(activeImage);
    };

    return (
        <li className="w-16 h-20 my-5 mr-8 relative" onChange={handleImageChange}>
            <img src={activeImage} alt={label}/>
        </li>
    );
};

export default TestimonialThumbnail;
